package ck.vo;

public class MapVO {
	private int map_seq;
	private int lat;
	private int lon;
	private String path;
	private String p_id;
	public MapVO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getMap_seq() {
		return map_seq;
	}
	public void setMap_seq(int map_seq) {
		this.map_seq = map_seq;
	}
	public int getLat() {
		return lat;
	}
	public void setLat(int lat) {
		this.lat = lat;
	}
	public int getLon() {
		return lon;
	}
	public void setLon(int lon) {
		this.lon = lon;
	}
	public String getPath() {
		return path;
	}
	public void setPath(String path) {
		this.path = path;
	}
	public String getP_id() {
		return p_id;
	}
	public void setP_id(String p_id) {
		this.p_id = p_id;
	}
	
	
}
